// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import {AccessControlUpgradeable} from '@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol';
import {Initializable} from '@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol';
import {ReentrancyGuardUpgradeable} from '@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol';

contract Base is
    Initializable,
    AccessControlUpgradeable,
    ReentrancyGuardUpgradeable
{
    /**
     * @notice Roles Variable
     */
    bytes32 public constant MODERATOR_ROLE = keccak256('MODERATOR_ROLE');

    /**
     * @notice Error Codes
     */
    string public constant ERROR_UNAUTHORIZED_ACCESS = '0';
    string public constant ERROR_NOT_FOUND = '1';
    string public constant ERROR_INVALID_PRICE = '2';
    string public constant ERROR_PROCESS_FAILED = '3';
    string public constant ERROR_EXPIRED_RESOURCE = '4';

    /**
     * @notice Initialize function
     * @param _admin The address of the administrator
     */
    function init_base_app(address _admin) public onlyInitializing {
        __AccessControl_init();
        _grantRole(DEFAULT_ADMIN_ROLE, _admin);
    }

    function _initError(
        string memory error
    ) internal pure returns (string memory) {
        return string.concat('BC: ', error);
    }
}

contracts/Gateway.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import {Base} from './Base.sol';
import {Bill, BillType} from './interfaces/Bill.sol';
import {Transaction, TransactionType} from './interfaces/Transaction.sol';
import {ERC20Upgradeable} from '@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol';

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Gateway is Base {
    event TokenEnlisted(address indexed tokenAddress);
    event TokenDelisted(address indexed tokenAddress);
    event BillProcessed(
        address indexed from,
        uint256 indexed id,
        bytes externalTxId,
        bytes billId,
        uint256 timestamp
    );

    uint256 public txCount;
    uint256 public billCount;
    address[] private _tokenAddresses;

    mapping(uint256 => Bill) private _bills;
    mapping(address => bool) private _enlistedTokens;
    mapping(uint256 => Transaction) private _transactions;
    mapping(bytes => uint256) private _extBillIdToBill;
    mapping(bytes => uint256) private _extIdToTransaction;

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function init_gateway(address admin) public initializer {
        __AccessControl_init();
        init_base_app(admin);
        _grantRole(MODERATOR_ROLE, admin);
        _enlistedTokens[address(0)] = true;
    }
}

